import React, { Component } from "react";
import Axios from "axios";
var Sql_select = require("../sql/Sql_select.js");

interface IProps {}

class Create extends Component<IProps> {
  /**
   * @return {Component} Component
   */
  constructor(props: any) {
    super(props);
    this.state = {
      id: "",
      pw: "",
      pw_check: "",
      name: "",
      phone: "",
      SSN: "",
      email: "",
    };
  }

  state = {
    id: "",
    pw: "",
    pw_check: "",
    name: "",
    phone: "",
    SSN: "",
    email: "",
  };

  handleChange = (e: any) => {
    this.setState({
      [e.target.name]: e.target.value,
    });
  };

  pre_id_Check = () => {
    if (this.state.id === "") {
      alert("아이디를 입력하세요");
    } else {
    }
  };

  render() {
    return (
      <div className="box">
        <form className="create_form">
          <fieldset className="inner_form">
            <legend className="title">회원가입</legend>
            <div className="id_title">
              <span className="subtitle1">아이디 : </span>
              <div className="id_section">
                <input
                  type="text"
                  name="id"
                  className="id"
                  value={this.state.id}
                  placeholder="아이디를 입력해주세요"
                  onChange={this.handleChange}
                ></input>
                <button
                  type="button"
                  className="id_check_btn"
                  onClick={this.pre_id_Check}
                >
                  중복
                </button>
              </div>
            </div>
            <div>
              <span className="subtitle">비밀번호 : </span>
              <input
                type="password"
                name="pw"
                className="pw"
                value={this.state.pw}
                placeholder="비밀번호를 입력해주세요"
                onChange={this.handleChange}
              ></input>
            </div>
            <div>
              <span className="subtitle">비밀번호 확인 : </span>
              <input
                type="password"
                name="pw_check"
                className="pw"
                value={this.state.pw_check}
                placeholder="비밀번호를 입력해주세요"
                onChange={this.handleChange}
              ></input>
            </div>
            <div>
              <span className="subtitle1">이름 : </span>
              <input
                type="text"
                name="name"
                className="name"
                value={this.state.name}
                placeholder="이름을 입력해주세요"
                onChange={this.handleChange}
              ></input>
            </div>
            <div>
              <span className="subtitle">전화번호 : </span>
              <input
                type="text"
                name="phone"
                className="phone"
                value={this.state.phone}
                placeholder="전화번호를 입력해주세요"
                onChange={this.handleChange}
              ></input>
            </div>
            <div>
              <span className="subtitle">주민번호 : </span>
              <input
                type="text"
                name="SSN"
                className="SSN"
                value={this.state.SSN}
                placeholder="주민번호를 입력해주세요"
                onChange={this.handleChange}
              ></input>
            </div>
            <div>
              <span className="subtitle">e-mail : </span>
              <input
                type="text"
                name="email"
                className="email"
                value={this.state.email}
                placeholder="이메일을 입력해주세요"
                onChange={this.handleChange}
              ></input>
            </div>
          </fieldset>
          <button className="create_btn">확인</button>
        </form>
      </div>
    );
  }
}

export default Create;
